Różnice kursowe dotyczące  środków pieniężnych zalicza się: dodatnie do przychodów z tytułu operacji  finansowych, a różnice ujemne - do kosztów tych operacji.
Nie zrealizowane na dzień bilansowy ujemne różnice kursowe dotyczące kredytów odnosi się na konto 75 "Przychody finansowe", natomiast dodatnie na konto84"Przyychody przyszłych okresów" przy uwzględnieniu kompensaty walut.
Zasady powyższe nie dotyczą różnic kursowych od kredytów na inwestycje w okresie realizacji, które zalicza się do kosztów inwestycji i księguje się na koncie 08 - "Środki trwałe w budowie".

Krótkoterminowe aktywa finansowe ujmuje się w ciągu roku obrotowego według ich cen nabycia, na koniec roku obrotowego - na dzień bilansowy - według cen ich nabycia, nie wyższych jednak od ich cen sprzedaży netto.

Konta zespołu 1 przeznaczone są do ewidencji:
 - krajowych i zagranicznych środków pieniężnych przechowywanych w kasach,
- krajowych i zagranicznych środków pieniężnych lokowanych na rachunkach bankowych,
- kredytów bankowych udzielonych przez banki krajowe i zagraniczne,
- przeznaczonych do obrotu papierów wartościowych,
 - innych środków pieniężnych,
- środków pieniężnych w drodze.
Zadaniem konto zespołu 1 jest odzwierciedlenie:
- operacji pieniężnych i stanów w zakresie środków pieniężnych przechowywanych w kasach,
- obrotów i stanów rachunków bankowych wyrażających należności z tytułu lokaty i zobowiązania  z tytułu wykorzystanych kredytów bankowych,
- operacji i stanów  w zakresie  papierów wartościowych przeznaczonych do obrotu i innych środków pieniężnych.


Zespół 2 - Rozrachunki i roszczenia

Konta zespołu 2 służą do ewidencji wszelkich krajowych i zagranicznych rozrachunków oraz roszczeń, a także do rozliczeń wynagrodzeń, niedoborów, szkód i nadwyżek oraz innych rozliczeń związanych z rozrachunkami i roszczeniami spornymi.
Ewidencją na kontach zespołu 2 objęte są w szczególności:
- bezsporne rozrachunki z odbiorcami i dostawcami zarówno długoterminowe (których okres spłaty na dzień bilansowy jest dłuższy niż rok) jak i krótkoterminowe (których okres spłaty na dzień bilansowy jest nie dłuższy niż rok);
- zobowiązania wekslowe;
 - należności z tytułu zaliczek przekazanych na poczet inwestycji, wartości niematerialnych i prawnych oraz dostaw;
- otrzymane od kontrahentów zaliczki na poczet przyszłych dostaw, robót i usług;
- należności wątpliwych i trudnych do wyegzekwowania w tym także od odbiorców postawionych w stan upadłości i likwidacji;
- rozrachunki z tytułu podatków i ubezpieczeń społecznych;
- rozliczenie VAT-u naliczonego i należnego;
- rozrachunki z tytułu wypłat wynagrodzeń;
- inne rozrachunki z pracownikami;
- pozostałe rozrachunki;
- należności dochodzone na drodze sądowej;
a także rozliczenia:
- różnic kursowych;
- niedoborów, szkód i nadwyżek;
 - należności i zobowiązania warunkowe.

W ciągu roku obrotowego należności i zobowiązania wyrażone są w walucie polskiej ujmuje się w księgach rachunkowych według ich wartości nominalnej z dnia ich powstania, tj w kwotach brutto (razem z naliczonym podatkiem
